import axios from "axios";

function App() {
  const [data, setData] = this.useState({ data: [] });

  useEffect(async () => {
    const response = await axios(
      "https://api.coindesk.com/v1/bpi/currentprice.json"
    );
    setData(response);
  });
  console.log("object", data.data);
  return (
    <div>
      <h1>the new app works</h1>
      hello App
    </div>
  );
}

export default App;
